import React, {Component} from 'react';
import comma from './img/comma.png';


class TableRow extends Component {
    
    render() {
        return (

            <div>
                <img src = {comma}/>
                <p>
                   {this.props.obj.message}
                </p>
                <br/>
                <div>
                    <img src = ""/>
                    <div>
                      <h4>{this.props.obj.email}</h4>
                      <h6>{this.props.obj.type}</h6>
                    </div>
                    
                </div>
            </div>
        );
    }
}

export default TableRow;
